import PopupState, { bindTrigger, bindPopover } from 'material-ui-popup-state';

const theme = createMuiTheme({
    spacing: 4
});

const styles = {
    root: {
        padding: '4px 4px',
        display: 'flex',
        alignItems: 'center',
        width: 310,
        boxShadow: 800,
        borderRadius: 0,
        backgroundColor: 'cyan',

    },

    rootdialogue: {
        display: 'flex',
        '& > *': {
            margin: theme.spacing(0),
            width: theme.spacing(20),
            height: theme.spacing(16),
        },
    },

    shadow: {
        backgroundColor: 'pink',
        width: 310,
        border: 8,
        //marginLeft :120,
        marginBottom: 10,
        marginRight: 10,
    },

    takeNote: {
        padding: '2px 4px',
        display: 'flex',
        alignItems: 'center',
        width: 400,
        marginTop: 0,
        boxShadow: 'None',
        borderRadius: 0,
        wordBreak: 'break-all'
    },

    input: {
        marginLeft: theme.spacing(1),
        flex: 1,
        wordBreak: 'break-all'
    },

    iconButton: {
        padding: 10,
        backgroundColor: 'pink',
        marginLeft: 50
    },

    divider: {
        height: 28,
        margin: 4,
    },

    editIcon: {
        color: 'inherit',

    }
};



class List extends React.Component {
    render() {
        const { classes } = this.props;

        return (
            <PopupState variant="popover" popupId="demo-popup-popover">
                {popupState => (
            <div>
                <Paper className={classes.shadow} onClick={() => console.log("hi")}>
                    <Paper component="form" className={classes.root}>
                        <Typography style={{ width: 260 }}>
                            I am the title
                        </Typography>


                    </Paper>
                    <Paper component="form" className={classes.root}>
                        <Typography>
                        I am the note
                        </Typography>
                    </Paper>
                    <Paper component="form" className={classes.root}>
                        <IconButton className={classes.editIcon} ><AddAlertIcon /></IconButton>
                        <IconButton className={classes.editIcon}><PersonAddOutlinedIcon /></IconButton>
                        <IconButton className={classes.editIcon}><ColorLensOutlinedIcon /></IconButton>
                        <IconButton className={classes.editIcon}><ImageOutlinedIcon /></IconButton>
                        <IconButton className={classes.editIcon} ><ArchiveOutlinedIcon /></IconButton>

                    </Paper>
                </Paper>
            </div>
        )
    }
            </PopupState>
        )
    }
}

export default withStyles(styles)(List);
